import React from 'react'

export const ListCoownershio = ({params}) => {
    return (
        <div >
            <h5 className="text-center">{params.locals.titleCoownerShip}</h5>
            {
                Coownership.map( coo => (
                    <Simple key={coo.id} datos={{link:coo.id, picture:coo.picture, name:coo.name}}/>
                                    ))
            }
        </div>
    )
}
